    const [data, setData] = useState(null);
    const [pack, setPack] = useState()

    useEffect(() => {
        axios.get("https://api.scryfall.com/sets")
        .then(res => {
            setData(res.data.data.map(set => 
                <option key={set.id}>{set.name}</option>))
                console.log(res)
        })      
    }, []);

   const openPack = () => {
        axios.get(`http://api.scryfall.com/sets/aer`
        .then(res => {
            console.log(res)
        }))
    }

    return(
    <div>
